message:
Introduces lambda-friendly api

We had new api over TypeMap and ModelMapper for lambda friendly api

In TypeMap, we had TypeMap.addMapping and you can do something like
typeMap.addMapping(Src::getA, Dest::setB),

or more complicated with
typeMap.addMappings(mapping -> mapping.with(provider).map(...))
       .addMappings(mapping -> mapping.using(converter).map(...))
       .addMappings(mapping -> mapping.when(condition).map(...))
       .addMappings(mapping -> mapping.skip(Dest::setField))

or
typeMap.addMappings(mapping -> {
    mapping.with(provider).map(...);
    mapping.using(converter).map(...);
    mapping.when(condition).map(...);
    mapping.map(...);
    mapping.skip(...);
});
